import React,{Component} from 'react';
import picture from '../../img/profile_pic.jpeg';
import './About.css'
class About extends Component{
    render(){

        return(
            <div>
                <div className="my-info">
                <h1>Natali Aviv</h1>
                <img src={picture} width="300" alt='profile' height="400"/>
                </div>
                <div className="about">
                    <p></p>
                </div>
            </div>
        );
    }
}

export default About;
